export default function fetchStockDataIEX(ticker){
    var price = 0;

        const userAction = async () => {
            const response = await fetch('https://sandbox.iexapis.com/stable/stock/'+ticker+'/price?token=Tsk_b7a45cc65e624a55a5688d15eac1b692');
            const myJson = await response.json(); //extract JSON from the http response
            var price = myJson.price;
        }

    let data = {"Symbol":ticker,"price":price,"open":21,"close":21};

    return data;


}
